import React from "react";
import styled from "styled-components";
import { HeroSection } from "./components/HeroSection";

const HomeContainer = styled.div`
  width: 100%;
`;

export const Home: React.FC = () => {
  return (
    <HomeContainer>
      <HeroSection />
    </HomeContainer>
  );
};
